import { NavLink } from 'react-router-dom';

import s from './AuthNav.module.css';

function AuthNav() {
    return <nav className={s.registration}>
        <NavLink className={s.signin} to='/login'>Sign In</NavLink>
        <NavLink className={s.signup} to='/register'>Sign Up</NavLink>
    </nav>
}
export default AuthNav;
